import React, { useEffect, useRef } from 'react'

// MapDisplay shows OpenStreetMap with incidents (red) and vehicles (blue)
// Coordinates are normalized [0-1] relative to map bounds

export default function MapDisplay({ incidents = [], vehicles = [], selectedIncidentLocation, selectedVehicleLocation, onMapClick }){
  const mapRef = useRef(null)
  const mapInstanceRef = useRef(null)
  const markersRef = useRef({ incidents: {}, vehicles: {}, selected: {} })

  const CENTER = [30.0635840, 31.4889939]
  const ZOOM = 14.5

  // Convert normalized coords to lat/lng
  const normToLatLng = (norm) => {
    if (!mapInstanceRef.current || !norm) return null
    const bounds = mapInstanceRef.current.getBounds()
    const lat = bounds.getSouth() + (bounds.getNorth() - bounds.getSouth()) * (1 - norm.y)
    const lng = bounds.getWest() + (bounds.getEast() - bounds.getWest()) * norm.x
    return [lat, lng]
  }

  // Convert lat/lng to normalized coords
  const latLngToNorm = (lat, lng) => {
    if (!mapInstanceRef.current) return null
    const bounds = mapInstanceRef.current.getBounds()
    const x = (lng - bounds.getWest()) / (bounds.getEast() - bounds.getWest())
    const y = 1 - (lat - bounds.getSouth()) / (bounds.getNorth() - bounds.getSouth())
    return { x: parseFloat(x.toFixed(4)), y: parseFloat(y.toFixed(4)) }
  }

  useEffect(() => {
    if (!mapRef.current || mapInstanceRef.current) return

    // Load Leaflet CSS and JS
    const link = document.createElement('link')
    link.rel = 'stylesheet'
    link.href = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.css'
    document.head.appendChild(link)

    const script = document.createElement('script')
    script.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.9.4/leaflet.min.js'
    script.onload = () => {
      const map = window.L.map(mapRef.current).setView(CENTER, ZOOM)

      window.L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: '© OpenStreetMap contributors'
      }).addTo(map)

      map.on('click', (e) => {
        const norm = latLngToNorm(e.latlng.lat, e.latlng.lng)
        onMapClick && onMapClick(norm)
      })

      mapInstanceRef.current = map
    }
    document.head.appendChild(script)

    return () => {
      if (mapInstanceRef.current) {
        mapInstanceRef.current.remove()
        mapInstanceRef.current = null
      }
    }
  }, [])

  useEffect(() => {
    if (!mapInstanceRef.current) return

    const map = mapInstanceRef.current
    const markers = markersRef.current

    // Clear old markers
    Object.values(markers.incidents).forEach(m => map.removeLayer(m))
    Object.values(markers.vehicles).forEach(m => map.removeLayer(m))
    Object.values(markers.selected).forEach(m => map.removeLayer(m))
    markers.incidents = {}
    markers.vehicles = {}
    markers.selected = {}

    // Add incident markers (pending only)
    incidents.filter(i => i.status === 'pending').forEach(inc => {
      const pos = normToLatLng(inc.location)
      if (pos) {
        const marker = window.L.circleMarker(pos, {
          radius: 8,
          fillColor: 'red',
          color: '#900',
          weight: 1,
          fillOpacity: 0.8
        }).addTo(map)
        marker.bindPopup(inc.name)
        markers.incidents[inc.id] = marker
      }
    })

    // Add vehicle markers
    vehicles.forEach(veh => {
      const pos = normToLatLng(veh.location)
      if (pos) {
        const marker = window.L.circleMarker(pos, {
          radius: 8,
          fillColor: 'blue',
          color: '#003',
          weight: 1,
          fillOpacity: 0.8
        }).addTo(map)
        marker.bindPopup(veh.name)
        markers.vehicles[veh.id] = marker
      }
    })

    // Add selected markers
    if (selectedIncidentLocation) {
      const pos = normToLatLng(selectedIncidentLocation)
      if (pos) {
        markers.selected.incident = window.L.circleMarker(pos, {
          radius: 6,
          fillColor: 'limegreen',
          color: '#065',
          weight: 1,
          fillOpacity: 0.9
        }).addTo(map)
      }
    }

    if (selectedVehicleLocation) {
      const pos = normToLatLng(selectedVehicleLocation)
      if (pos) {
        markers.selected.vehicle = window.L.circleMarker(pos, {
          radius: 6,
          fillColor: '#00cc66',
          color: '#036',
          weight: 1,
          fillOpacity: 0.9
        }).addTo(map)
      }
    }
  }, [incidents, vehicles, selectedIncidentLocation, selectedVehicleLocation])

  return (
    <div className="map-container panel">
      <div style={{textAlign:'center', paddingBottom:6}} className="coords-box">Click map to pick location</div>
      <div ref={mapRef} style={{ width: '100%', height: '500px' }} />
    </div>
  )
}
